import React, {Component} from "react";

class entrada extends Component{
  render(){
    return(
      <section>
        <h1>To Do List</h1>
        <div>
          <input type="text" />
          <button type="button">Adicionar</button>
        </div>
      </section>
    );
  }
}

export default entrada;
